import React, { Component } from 'react'
import { Container, Header, Icon, Segment, Table, Grid, Button } from 'semantic-ui-react';
import './App.css';

class signInPage extends Component {
  render() {
    return (
      <Container>
        <Segment color='purple'>
          <Header>
          PLEASE SIGN IN WITH YOUR NETID
          </Header>
          <Button primary />
        </Segment>
      </Container>
    )
  }
}

export default signInPage
